import React, {Component} from "react";
import casino_games from '../../casino_games.json';
import  CasinoGame from '../CasinoGame/CasinoGame.js'
import styles from './casinoGamesList.module.css'
export default class CasinoGamesList extends Component {
  state ={
    casinoGames: casino_games
  };

  render(){
      const { casinoGames } = this.state;

      return (
    <div className="container">
      <ul className={styles.casinoGamesList}>
        {casinoGames.map(casinoGame => (
                <CasinoGame casinoGame={casinoGame}/>
            )
        )}
      </ul>
    </div>
   )
  }
}


